import React from 'react';
import { Link } from 'react-router-dom';

const Navbar = () => {
    return (
        <nav>
            <ul>
                <li><Link to="/" className='navbar-text'>Home</Link></li>
                <li><Link to="/accepted" className='navbar-text'>Accepted</Link></li>
                <li><Link to="/inprogress" className='navbar-text'>In Progress</Link></li>
                <li><Link to="/pending" className='navbar-text'>Pending</Link></li>
                <li><Link to="/completion-score">Completion Score</Link></li>
            </ul>
        </nav>
    );
};

export default Navbar;
